import "./PageSix.css"

function PageSix() {
    return(
        <div className="container">
            <div className="text-center">
                <p className="pageSixSmallText">STAY IN TOUCH</p>
                <p className="pageSixText">Join our email. First to know about specials,events and more!</p>
                <input className="inputPageSix" placeholder="Enter your email address"><button className="btn btn-primary">Subscribe</button></input>
            </div>
        </div>
    );
}

export default PageSix
